INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES (1,GETDATE(),'ACFC4A7DA2BE4F039F85001BDF417CAD',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Ventas Brutas','Importe total de ventas antes de impuestos sin incluir ventas canceladas.','Ventas Brutas',2,'#,#.00','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'var qry = "SELECT SUM((v.subtotal-v.descuento1-v.descuento2)*v.tipocambio)AS vnsBrutas  FROM venta v WHERE (year(v.fecha)*10000)+(month(v.fecha)*100)+day(v.fecha) >= " + inicio + " AND (year(v.fecha )*10000)+(month(v.fecha )*100)+day(v.fecha ) <= " + final + " AND ((v.documento = 3 AND v.statusFacturacion = 1) OR (v.documento = 6 AND v.StatusFacturacion = 1) OR v.documento = 4) AND v.StatusAdministrativo = 3";'+CHAR(13)+CHAR(10)+'return StatsEngine.getScalar(qry, ADOCnn);',2);
