INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES  (4,GETDATE(),'2F3EE251A5E845AC8BD174E74513179C',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Ventas Facturadas','Importe total de facturas de ventas antes de impuestos.','Ventas Facturadas',2,'#,#.00','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'var qry = "SELECT SUM((Venta.Subtotal-Venta.Descuento1-Venta.Descuento2)*venta.tipocambio) AS VentaSubTotal  FROM Venta WHERE Venta.Documento=4 AND Venta.StatusAdministrativo=3 AND (year(venta.fecha)*10000)+(month(venta.fecha)*100)+day(venta.fecha) >= " + inicio + " AND (year(venta.fecha)*10000)+(month(venta.fecha)*100)+day(venta.fecha ) <= " + final;'+CHAR(13)+CHAR(10)+'return StatsEngine.getScalar(qry, ADOCnn);',2);
INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES  (5,GETDATE(),'BE40619A18B8471E8FBB75F7003F1EED',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Costo de ventas','Importe total del costo de ventas correspondientes a las ventas netas.','Costo de ventas',2,'#,#.00','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'var qry = " SELECT (Sum(qryRepCostoVentas.Costo)) - (Sum(qryRepCostoVentas.CtDev)) as CostoVenta  FROM qryRepCostoVentas WHERE (qryRepCostoVentas.nd_Fecha)>=  " + inicio + " AND (qryRepCostoVentas.nd_Fecha)<=  " + final;'+CHAR(13)+CHAR(10)+'return StatsEngine.getScalar(qry, ADOCnn);',2);
INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES  (6,GETDATE(),'76606CA1A59A4AC1857FD3D5EF2FF0DB',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Impuestos trasladados','Importe de impuestos sobre las ventas netas.','Impuestos trasladados',2,'#,#.00','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'var impCobrados = "SELECT SUM((v.impuesto1 + v.impuesto2 + v.impuesto3 + v.impuesto4)*v.tipocambio) AS impCobrados  FROM venta v WHERE (year(v.fecha)*10000)+(month(v.fecha)*100)+day(v.fecha) >= " + inicio + " AND (year(v.fecha )*10000)+(month(v.fecha )*100)+day(v.fecha ) <= " + final + " AND ((((v.documento = 3) AND (v.statusFacturacion = 1)) OR ((v.documento = 6) AND (v.StatusFacturacion = 1)) OR (v.documento = 4)) AND (v.StatusAdministrativo = 3) )";'+CHAR(13)+CHAR(10)+'var impDevueltos = "SELECT SUM((v.impuesto1 + v.impuesto2 + v.impuesto3 + v.impuesto4)*v.tipocambio) as impuestosDev  FROM venta v WHERE (year(v.fecha)*10000)+(month(v.fecha)*100)+day(v.fecha) >= " + inicio + " AND (year(v.fecha )*10000)+(month(v.fecha )*100)+day(v.fecha ) <= " + final + " AND v.documento = 5";'+CHAR(13)+CHAR(10)+'return StatsEngine.getScalar(impCobrados,ADOCnn)-StatsEngine.getScalar(impDevueltos,ADOCnn);',2);
