INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES  (17,GETDATE(),'7733DD402CCB42D7B9BEF93F3DD1E959',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Costos indirectos','Es la sumatoria de los costos indirectos de las compras netas.','Costos indirectos',2,'#,#.00','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'var qryBrutas =  "SELECT SUM((c.indirectos)*c.tipocambio )AS costosIndirectos  FROM compra c WHERE ((((c.documento = 3) and (c.StatusFacturacion = 1)) OR (c.documento= 4)) AND (c.StatusAdministrativo = 3)) AND (year(c.fecha)*10000)+(month(c.fecha)*100)+day(c.fecha) >= " + inicio + " AND (year(c.fecha)*10000)+(month(c.fecha)*100)+day(c.fecha) <= " + final;'+CHAR(13)+CHAR(10)+'var qryDevoluciones =  "SELECT SUM((c.indirectos)*c.tipocambio )AS costosIndirectos  FROM compra c WHERE c.documento= 5 AND (year(c.fecha)*10000)+(month(c.fecha)*100)+day(c.fecha) >= " + inicio + " AND (year(c.fecha)*10000)+(month(c.fecha)*100)+day(c.fecha) <= " + final;'+CHAR(13)+CHAR(10)+'return StatsEngine.getScalar(qryBrutas, ADOCnn)- StatsEngine.getScalar(qryDevoluciones, ADOCnn);'+CHAR(13)+CHAR(10)+'',3);
INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES  (18,GETDATE(),'9DB2E823847246DC9FE7732B1428009C',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Impuestos acreditables','Importe de impuestos  totales sobre las compras realizadas menos los impuestos por devoluci?n.','Impuestos acreditables',2,'#,#.00','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'var impCobrados = "SELECT SUM((c.impuesto1 + c.impuesto2 + c.impuesto3 + c.impuesto4)*c.tipocambio) AS impCobrados  FROM compra c WHERE (year(c.fecha)*10000)+(month(c.fecha)*100)+day(c.fecha) >= " + inicio + " AND (year(c.fecha)*10000)+(month(c.fecha )*100)+day(c.fecha ) <= " + final + " AND ((((c.documento = 3) AND (c.statusFacturacion = 1)) OR (c.documento = 4)) AND (c.StatusAdministrativo = 3) )";'+CHAR(13)+CHAR(10)+'var impDev = "SELECT SUM((c.impuesto1 + c.impuesto2 + c.impuesto3 + c.impuesto4) *c.tipocambio ) AS impuestosDev FROM compra c WHERE (year(c.fecha)*10000)+(month(c.fecha)*100)+day(c.fecha) >= " + inicio + " AND (year(c.fecha )*10000)+(month(c.fecha )*100)+day(c.fecha ) <= " + final + " AND c.documento = 5";'+CHAR(13)+CHAR(10)+'return StatsEngine.getScalar(impCobrados,ADOCnn)-StatsEngine.getScalar(impDev,ADOCnn);'+CHAR(13)+CHAR(10)+'',3);
INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES  (19,GETDATE(),'9566973515AC4814BAC37C62C568CE3C',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Operaciones de compra','Es la cantidad de compras realizadas en el periodo incluyendo compras canceladas.','Operaciones de compra',0,'#','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'var qry = "SELECT COUNT(c.sys_pk) AS OperacionesCompra FROM compra c WHERE ((((c.documento = 3) AND (c.statusFacturacion = 1)) OR (c.documento = 4)) AND (c.StatusAdministrativo = 3 OR c.statusadministrativo = 99)) AND ((Year(c.Fecha)*10000)+(Month(c.Fecha)*100)+Day(c.Fecha))>=  " + inicio + " AND ((Year(c.Fecha)*10000)+(Month(c.Fecha)*100)+Day(c.Fecha))<= " + final;'+CHAR(13)+CHAR(10)+'return StatsEngine.getScalar(qry, ADOCnn);'+CHAR(13)+CHAR(10)+'',3);
INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES  (20,GETDATE(),'76EE5F63465F48278100F33283DEBC5E',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Operaciones de devoluci?n','Es la cantidad de notas de cr?dito generadas en el periodo.','Operaciones de devoluci?n',0,'#','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'var qry = "SELECT COUNT(sys_pk) AS OperacionesDevolucion FROM compra c WHERE ((Year(c.Fecha)*10000)+(Month(c.Fecha)*100)+Day(c.Fecha))>= " + inicio + " AND ((Year(c.Fecha)*10000)+(Month(c.Fecha)*100)+Day(c.Fecha))<= " + final + " AND c.documento = 5";'+CHAR(13)+CHAR(10)+'return StatsEngine.getScalar(qry, ADOCnn);'+CHAR(13)+CHAR(10)+'',3);
INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES  (21,GETDATE(),'89AFC36BE3C442A58E0072622264E1EA',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Operaciones canceladas','Es la cantidad de  compras que se cancelaron en el periodo.','Operaciones canceladas',0,'#','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'var qry = " SELECT COUNT(c.sys_pk) AS OperacionesCanceladas FROM compra c WHERE ((Year(c.Fecha)*10000)+(Month(c.Fecha)*100)+Day(c.Fecha))>= " + inicio + " AND ((Year(c.Fecha)*10000)+(Month(c.Fecha)*100)+Day(c.Fecha))<= " + final + " AND ((((c.documento = 3) AND (c.statusFacturacion = 1))  OR (c.documento = 4)) AND (c.StatusAdministrativo = 99) )";'+CHAR(13)+CHAR(10)+'return StatsEngine.getScalar(qry, ADOCnn);'+CHAR(13)+CHAR(10)+'',3);
INSERT INTO ut_bi_metrica (Sys_PK,Sys_TimeStamp,Sys_GUID,Sys_DTCreated,Sys_User,Sys_LastUser,Sys_Exported,Sys_DTExported,Sys_Info,uf_Nombre,uf_Descripcion,uf_Titulo,uf_Decimales,uf_Formato,uf_Codigo,uf_FK_Perspectiva) VALUES  (22,GETDATE(),'8D8C382A20004ABA9D62D701E7FBFD75',GETDATE(),NULL,NULL,0,GETDATE(),NULL,'Compra promedio','Es la divisi?n de compras brutas entre operaciones de compras.','Compra promedio',2,'#,#.00','//Lenguaje: javascript'+CHAR(13)+CHAR(10)+'//Objetos disponibles: ADOCnn, StatsEngine, _ejecutar y _fecha'+CHAR(13)+CHAR(10)+'//Par?metros: sys_pk, inicio, final  [function_ClaveMetrica(sys_pk,inicio,final){}] '+CHAR(13)+CHAR(10)+'//El valor debe ser devuelto mediante una sentencia return'+CHAR(13)+CHAR(10)+'//M?trica compras brutas/m?trica operaciones de compra'+CHAR(13)+CHAR(10)+'var operaciones=_ejecutar.obtener_metrica(''9566973515AC4814BAC37C62C568CE3C'', ADOCnn, sys_pk, inicio, final);'+CHAR(13)+CHAR(10)+'if(operaciones>0){'+CHAR(13)+CHAR(10)+'   return _ejecutar.obtener_metrica(''16840A45F3DB410CA8DC76F7CC1CB444'', ADOCnn, sys_pk, inicio, final)/ operaciones;'+CHAR(13)+CHAR(10)+'}else{'+CHAR(13)+CHAR(10)+'    return 0;'+CHAR(13)+CHAR(10)+'}'+CHAR(13)+CHAR(10)+'',3);
