create view qryPromedioRetraso AS SELECT z.semanacierre, z.fechacierre, z.NDCierre, z.PKTipoCaso, (CONVERT(DATETIME, CONVERT(varchar(10), z.fechacierre, 120)) + ' ' + CONVERT(varchar(10), z.horacierre, 108)) - (CONVERT(DATETIME, CONVERT(varchar(10), z.fechaapertura, 120)) + ' ' + CONVERT(varchar(10), z.horaapertura, 108))  AS Duracion, DATEPART(HH, replace(z.mDiferencia,'-',''))  AS Total FROM qryadmoncasos_2 z WHERE (z.status = 1) AND (z.mDiferencia IS NOT NULL);

