ALTER TABLE DCxC ADD FechaProxCobro DATE;
ALTER TABLE DCxC ADD PorAcuerdoPago BIT DEFAULT 0;
ALTER TABLE DCxC ADD AcuerdoDePago INTEGER DEFAULT 0; 

CREATE TABLE ut_CRM_Acuerdos (Sys_PK INTEGER IDENTITY PRIMARY KEY, Sys_TimeStamp DATETIME, Sys_GUID VARCHAR(32) NOT NULL UNIQUE, Sys_DTCreated DATETIME, Sys_User VARCHAR(5), Sys_LastUser VARCHAR(5), Sys_Exported TINYINT DEFAULT 0, Sys_DTExported DATETIME, Sys_Info VARCHAR(32), Referencia VARCHAR(10) NOT NULL UNIQUE, NumAcuerdo INTEGER DEFAULT 0, Fecha DATE, FPagoAcordada DATE, FechaCumplimiento DATE, IVenta INTEGER NOT NULL, IPagare INTEGER, IUsuario INTEGER NOT NULL, ImporteAcordado DECIMAL(19,8) NOT NULL DEFAULT 0, Cumplido BIT DEFAULT 0, ResponsableAcuerdo VARCHAR(255), IRecibo INTEGER, Notas TEXT);
CREATE TABLE ut_CRM_Acuerdos_Recibos_ (Sys_PK	INTEGER IDENTITY PRIMARY KEY, Sys_TimeStamp DATETIME, Sys_GUID VARCHAR(32) NOT NULL UNIQUE, Sys_DTCreated DATETIME, Sys_User VARCHAR(5), Sys_LastUser VARCHAR(5), Sys_Exported TINYINT DEFAULT 0, Sys_DTExported DATETIME, Sys_Info VARCHAR(32), Fecha DATE, IAcuerdo INTEGER, IRecibo INTEGER, IUsuario INTEGER);

DROP VIEW QryCRMSaldoClientes;
CREATE VIEW QryCRMSaldoClientes AS SELECT dcxc.Sys_PK AS PKDCxC, cliente.Sys_PK AS PKCliente, cliente.Codigo AS CCodigo, cliente.Nombre AS CNombre, dcxc.Referencia AS Referencia, dcxc.Aplicacion AS vencimiento, DATEDIFF(DAY, dcxc.Aplicacion, GETDATE()) AS dias, ISNULL(agente.Sys_PK, 0) AS PKAgente, ISNULL(agente.Codigo,'0000') AS ACodigo, ISNULL(agente.Nombre, 'Sin vendedor') AS ANombre, (((YEAR(dcxc.Aplicacion) * 10000) + (MONTH(dcxc.Aplicacion) * 100)) + DAY(dcxc.Aplicacion)) AS NDFecha, dcxc.Debe AS importe, (((dcxc.Debe + dcxc.IntMoratorios) - dcxc.Bonificaciones) - dcxc.Pagos) AS Saldo, dcxc.AcuerdoDePago AS AcuerdoPago, ut_crm_acuerdos.FPagoAcordada AS VencimientoAcuerdo, (((YEAR(ut_crm_acuerdos.FPagoAcordada) * 10000) + (MONTH(ut_crm_acuerdos.FPagoAcordada) * 100)) + DAY(ut_crm_acuerdos.FPagoAcordada)) AS NDFechaAcuerdo FROM ((((dcxc LEFT JOIN ut_CRM_Acuerdos ON dcxc.AcuerdoDePago = ut_CRM_Acuerdos.Sys_PK) JOIN cliente ON ((dcxc.ICliente = cliente.Sys_PK))) LEFT JOIN venta ON ((dcxc.IVenta = venta.Sys_PK))) LEFT JOIN agente ON ((venta.IAgente = agente.Sys_PK))) WHERE ((dcxc.Aplicable <> 0) AND ((((dcxc.Debe + dcxc.IntMoratorios) - dcxc.Bonificaciones) - dcxc.Pagos) <> 0)) GROUP BY dcxc.Sys_PK, agente.Sys_PK, agente.Codigo, agente.Nombre, dcxc.IntMoratorios, dcxc.Bonificaciones, dcxc.Pagos, dcxc.AcuerdoDePago, ut_crm_acuerdos.fpagoacordada, cliente.Sys_PK, cliente.Codigo, cliente.Nombre, dcxc.Referencia, dcxc.Aplicacion, dcxc.Debe;

DROP VIEW QryCatClientes;
CREATE VIEW QryCatClientes AS SELECT DISTINCT cliente.Sys_PK AS Sys_PK, tipocliente.Sys_PK AS PKTipoCliente, cliente.Codigo AS Codigo, cliente.Nombre AS Nombre, cliente.RFC AS RFC, domicilio.Direccion AS Direccion, domicilio.Colonia AS Colonia, domicilio.CodPos AS Codigo_Postal, domicilio.Telefonos AS Telefono, cliente.eMail AS eMail, cliente.Saldo AS Saldo,(SELECT COUNT(ut_CRM_Acuerdos.Sys_PK) AS NumAcuerdos FROM (ut_CRM_Acuerdos INNER JOIN Venta ON ut_CRM_Acuerdos.IVenta = Venta.Sys_PK) WHERE Venta.ICliente = Cliente.Sys_PK AND ut_CRM_Acuerdos.Cumplido = 0) AS AcuerdosPendientes FROM ((cliente LEFT JOIN tipocliente ON ((cliente.Tipo = tipocliente.Sys_PK))) LEFT JOIN domicilio ON ((domicilio.Sys_PK = cliente.Domicilio1))) WHERE ISNULL(cliente.Uf_Sys_Baja, 0) = 0;

