CREATE TABLE r_p2o (Sys_PK INT NOT NULL IDENTITY, Sys_TimeStamp DATETIME NOT NULL, Sys_GUID VARCHAR(32) DEFAULT NULL, Sys_DTCreated DATETIME DEFAULT NULL, Sys_User VARCHAR(5) DEFAULT NULL, Sys_LastUser VARCHAR(5) DEFAULT NULL, Sys_Exported BIT DEFAULT NULL, Sys_DTExported DATETIME DEFAULT NULL, Sys_Info VARCHAR(32) DEFAULT NULL, Caduca BIT DEFAULT NULL, FCaducidad DATE DEFAULT NULL, Notas VARCHAR(255) DEFAULT NULL, Vigente BIT DEFAULT NULL, IOrganizacion INT NOT NULL, IPersona INT NOT NULL, ITipo INT NOT NULL, RolOrganizacion INT DEFAULT NULL, RolPersona INT DEFAULT NULL, PRIMARY KEY (Sys_PK), CONSTRAINT RLR_P2OIOrganizacion_OrganizacionSys_PK FOREIGN KEY (IOrganizacion) REFERENCES organizacion(Sys_PK) , CONSTRAINT RLR_P2OIPersona_PersonaSys_PK FOREIGN KEY (IPersona) REFERENCES persona(Sys_PK) , CONSTRAINT RLR_P2OITipo_TpRelacionSys_PK FOREIGN KEY (ITipo) REFERENCES tprelacion(Sys_PK) , CONSTRAINT RLR_P2ORolOrganizacion_MDRolSys_PK FOREIGN KEY (RolOrganizacion) REFERENCES mdrol(Sys_PK) , CONSTRAINT RLR_P2ORolPersona_MDRolSys_PK FOREIGN KEY (RolPersona) REFERENCES mdrol(Sys_PK) );
