CREATE TABLE xt_biticontact (Sys_PK INT NOT NULL IDENTITY, uf_Mensaje VARCHAR(MAX) NOT NULL, uf_Usuario VARCHAR(50) NOT NULL, uf_Tiempo DATETIME NOT NULL, uf_Iicontact INT NOT NULL, uf_IProy INT DEFAULT NULL, PRIMARY KEY (Sys_PK));
CREATE VIEW qactiproy AS SELECT TOP 100 PERCENT 'Proyecto' AS Tipo, proyecto.Sys_PK AS Sys_PK, actividad.FInicio AS Cita, (persona.Nombre + ' ' + ISNULL(persona.Apellido1,  '') +  ' ' + ISNULL(persona.Apellido2, '')) AS contacto, organizacion.Nombre AS empresa, (mdtpactividad.Nombre + ' ' + actividad.Asunto) AS asunto, organizacion.Tel1 AS telefono, persona.EMail AS email, proyecto.IEjecutivo AS ejecutivo FROM (((((mdtpactividad JOIN actividad ON mdtpactividad.Sys_PK = actividad.ITpActividad) JOIN proyecto ON actividad.IProyecto = proyecto.Sys_PK) JOIN meta ON proyecto.IMeta = meta.Sys_PK) JOIN organizacion ON organizacion.Sys_PK = proyecto.IOrganizacion) JOIN persona ON proyecto.IContacto = persona.Sys_PK) WHERE ((actividad.Hecho = 0) AND (proyecto.UF_Status1 <> 5) AND (proyecto.UF_Status1 <> 6) AND (CAST(actividad.FInicio AS date) <= CAST(GETDATE() AS date))) ORDER BY actividad.FInicio;
CREATE VIEW qacticon AS SELECT TOP 100 PERCENT 'Contacto' AS Tipo, ut_icontact.Sys_PK AS Sys_PK, ut_icontact.uf_proxcontac AS cita, ut_icontact.uf_Nombre AS contacto, ut_icontact.uf_Empresa AS empresa, 'Llamar para generar oportunidad' AS asunto, ut_icontact.uf_Telefono AS telefono, ut_icontact.uf_EMail AS email, ut_icontact.uf_IEjecutivo AS ejecutivo FROM ut_icontact WHERE ((ut_icontact.uf_Status = 0) AND ((CAST(ut_icontact.uf_proxcontac AS date) <= CAST(GETDATE() AS date)) OR ISNULL(ut_icontact.uf_proxcontac, 0) = 0)) ORDER BY ut_icontact.uf_proxcontac;
CREATE VIEW qhoyx AS SELECT TOP 100 PERCENT qactiproy.Tipo AS Tipo, qactiproy.Sys_PK AS Sys_PK, qactiproy.Cita AS Cita, qactiproy.contacto AS contacto, qactiproy.empresa AS empresa, qactiproy.asunto AS asunto, qactiproy.telefono AS telefono, qactiproy.email AS email, qactiproy.ejecutivo AS ejecutivo FROM qactiproy UNION ALL SELECT qacticon.Tipo AS Tipo, qacticon.Sys_PK AS Sys_PK, qacticon.cita AS cita, qacticon.contacto AS contacto, qacticon.empresa AS empresa, qacticon.asunto AS asunto, qacticon.telefono AS telefono, qacticon.email AS email, qacticon.ejecutivo AS ejecutivo FROM qacticon;
CREATE VIEW qhoy AS SELECT TOP 100 PERCENT qhoyx.Tipo AS Tipo, qhoyx.Sys_PK AS Sys_PK, qhoyx.Cita AS Cita, qhoyx.contacto AS contacto, qhoyx.empresa AS empresa, qhoyx.asunto AS asunto, qhoyx.telefono AS telefono, qhoyx.email AS email, qhoyx.ejecutivo AS ejecutivo FROM qhoyx;
CREATE VIEW qatascados AS SELECT 'Proyecto' AS tipo, proyecto.Sys_PK AS Sys_PK, NULL AS Cita, organizacion.Nombre AS empresa, 'Revizar estado del proyecto' AS contacto, 'sin asunto' AS asunto, 'verificar' AS telefono, 'verificar' AS email, proyecto.IEjecutivo AS ejecutivo FROM ((proyecto JOIN meta ON proyecto.IMeta = meta.Sys_PK) JOIN organizacion ON organizacion.Sys_PK = proyecto.IOrganizacion) WHERE ((proyecto.UF_Status1 <> 5) AND (proyecto.UF_Status1 <> 6));
CREATE VIEW qpersonasorgs AS SELECT TOP 100 PERCENT persona.Sys_PK AS Sys_PK, persona.Apellido1 AS Apellido1, persona.Apellido2 AS Apellido2, persona.Nombre AS Nombre, r_p2o.IOrganizacion AS IOrganizacion, (ISNULL(persona.Apellido1, '') + ' ' + ISNULL(persona.Apellido2, '') + ' ' + ISNULL(persona.Nombre, '')) AS NombreCompleto FROM (persona JOIN r_p2o ON persona.Sys_PK = r_p2o.IPersona) GROUP BY persona.Sys_PK, persona.Apellido1, persona.Apellido2, persona.Nombre, r_p2o.IOrganizacion;
CREATE TABLE UT_InteresContacto (Sys_PK INT IDENTITY PRIMARY KEY, Sys_TimeStamp DATETIME, Sys_GUID VARCHAR(32) UNIQUE, Sys_DTCreated DATETIME, Sys_User VARCHAR(5), Sys_LastUser VARCHAR(5), Sys_Exported BIT, Sys_DTExported DATETIME, Sys_Info VARCHAR(32), sys_recver INT, sys_deleted BIT, sys_lock BIT, uf_Interes VARCHAR(255) UNIQUE, uf_Descripcion VARCHAR(2048));
CREATE TABLE ut_OrigenContacto (Sys_PK INT IDENTITY PRIMARY KEY, Sys_TimeStamp DATETIME, Sys_GUID VARCHAR(32) UNIQUE, Sys_DTCreated DATETIME, Sys_User VARCHAR(5), Sys_LastUser VARCHAR(5), Sys_Exported BIT, Sys_DTExported DATETIME, Sys_Info VARCHAR(32), sys_recver INT, sys_deleted BIT, sys_lock BIT, uf_Origen VARCHAR(255) UNIQUE, uf_Descripcion VARCHAR(2048));
CREATE PROCEDURE AddOrigenContacto @Origen VARCHAR(255) AS BEGIN DECLARE @Contador INT; SET @Contador = (SELECT COUNT(Sys_PK) AS Counted FROM ut_OrigenContacto WHERE ut_OrigenContacto.uf_Origen = @Origen); if @Contador <= 0 BEGIN INSERT INTO ut_OrigenContacto (Sys_TimeStamp, Sys_GUID, Sys_DTCreated, Sys_Exported, Sys_DTExported, sys_recver, sys_deleted, sys_lock, uf_Origen, uf_Descripcion) VALUES (GETDATE(), REPLACE(NEWID(), '-', ''), GETDATE(), 0, GETDATE(), 0, 0, 0, @Origen, @Origen); END END
CREATE PROCEDURE AddInteresContacto @Interes VARCHAR(255) AS BEGIN DECLARE @Contador INT; SET @Contador = (SELECT COUNT(Sys_PK) AS Counted FROM UT_InteresContacto  WHERE UT_InteresContacto.uf_Interes = @Interes); IF @Contador <= 0 BEGIN INSERT INTO UT_InteresContacto (Sys_TimeStamp, Sys_GUID, Sys_DTCreated, Sys_Exported, Sys_DTExported, sys_recver, sys_deleted, sys_lock, uf_Interes, uf_Descripcion) VALUES (GETDATE(), REPLACE(NEWID(), '-', ''), GETDATE(), 0, GETDATE(), 0, 0, 0, @Interes, @Interes); END END
CREATE TABLE ut_ReferenciaContacto (Sys_PK INT IDENTITY PRIMARY KEY, Sys_TimeStamp DATETIME, Sys_GUID VARCHAR(32) UNIQUE, Sys_DTCreated DATETIME, Sys_User VARCHAR(5), Sys_LastUser VARCHAR(5), Sys_Exported BIT, Sys_DTExported DATETIME, Sys_Info VARCHAR(32), sys_recver INT, sys_deleted BIT, sys_lock BIT, uf_Referencia VARCHAR(255) UNIQUE, uf_Descripcion VARCHAR(2048));
CREATE PROCEDURE AddReferenciaContacto @Referencia VARCHAR(255) AS BEGIN DECLARE @Contador INT; SET @Contador = (SELECT COUNT(Sys_PK) AS Counted FROM ut_ReferenciaContacto WHERE ut_ReferenciaContacto.uf_Referencia = @Referencia); if @Contador <= 0 BEGIN INSERT INTO ut_ReferenciaContacto (Sys_TimeStamp, Sys_GUID, Sys_DTCreated, Sys_Exported, Sys_DTExported, sys_recver, sys_deleted, sys_lock, uf_Referencia, uf_Descripcion) VALUES (GETDATE(), REPLACE(NEWID(), '-', ''), GETDATE(), 0, GETDATE(), 0, 0, 0, @Referencia, @Referencia); END END

