CREATE TABLE gppersona_persona_ (Sys_PK int NOT NULL IDENTITY PRIMARY KEY, Sys_TimeStamp datetime NOT NULL, IPersonas INT NOT NULL, IGrupos INT NOT NULL, CONSTRAINT RLGpPersona_Persona_IGrupos_PersonaSys_PK FOREIGN KEY (IGrupos) REFERENCES gppersona (Sys_PK), CONSTRAINT RLGpPersona_Persona_IPersonas_GpPersonaSys_PK FOREIGN KEY (IPersonas) REFERENCES persona (Sys_PK));
CREATE VIEW qr_o2o1 AS SELECT r_o2o.Notas AS Notas, r_o2o.Sys_PK AS Sys_PK, tprelacion.Descripcion AS Tipo, organizacion.Nombre AS Nombre, mdrol.Nombre AS Rol1, mdrol_1.Nombre AS Rol2, r_o2o.IOrganizacion1 AS IOrganizacion1 FROM ((mdrol INNER JOIN (organizacion INNER JOIN (tprelacion INNER JOIN r_o2o ON tprelacion.Sys_PK = r_o2o.ITipo) ON organizacion.Sys_PK = r_o2o.IOrganizacion2) ON mdrol.Sys_PK = r_o2o.RolOrganizacion1) INNER JOIN mdrol mdrol_1 ON r_o2o.RolOrganizacion2 = mdrol_1.Sys_PK);
CREATE VIEW qr_o2o2 AS SELECT r_o2o.Notas AS Notas, r_o2o.Sys_PK AS Sys_PK, tprelacion.Descripcion AS Tipo, organizacion.Nombre AS Nombre, mdrol.Nombre AS Rol2, mdrol_1.Nombre AS Rol1, r_o2o.IOrganizacion2 AS IOrganizacion2 FROM ((mdrol INNER JOIN (organizacion INNER JOIN (tprelacion INNER JOIN r_o2o ON tprelacion.Sys_PK = r_o2o.ITipo) ON organizacion.Sys_PK = r_o2o.IOrganizacion1) ON mdrol.Sys_PK = r_o2o.RolOrganizacion1) INNER JOIN mdrol mdrol_1 ON r_o2o.RolOrganizacion2 = mdrol_1.Sys_PK);
CREATE VIEW qr_o2p AS SELECT r_p2o.Notas AS Notas, r_p2o.Sys_PK AS Sys_PK, tprelacion.Descripcion AS Tipo, CONCAT(persona.Apellido1, ' ', ISNULL(persona.Apellido2, ''), ' ', persona.Nombre) AS Nombre, mdrol.Nombre AS Rol2, mdrol_1.Nombre AS Rol1, r_p2o.IOrganizacion AS IOrganizacion FROM ((mdrol INNER JOIN (persona INNER JOIN (tprelacion INNER JOIN r_p2o ON tprelacion.Sys_PK = r_p2o.ITipo) ON persona.Sys_PK = r_p2o.IPersona) ON mdrol.Sys_PK = r_p2o.RolPersona) INNER JOIN mdrol mdrol_1 ON r_p2o.RolOrganizacion = mdrol_1.Sys_PK);
CREATE VIEW qr_p2o AS SELECT r_p2o.Notas AS Notas, r_p2o.Sys_PK AS Sys_PK, tprelacion.Descripcion AS Tipo, organizacion.Nombre AS Nombre, mdrol.Nombre AS Rol1, mdrol_1.Nombre AS Rol2, r_p2o.IPersona AS IPersona FROM ((mdrol INNER JOIN (organizacion INNER JOIN (tprelacion INNER JOIN r_p2o ON tprelacion.Sys_PK = r_p2o.ITipo) ON organizacion.Sys_PK = r_p2o.IOrganizacion) ON mdrol.Sys_PK = r_p2o.RolPersona) INNER JOIN mdrol mdrol_1 ON r_p2o.RolOrganizacion = mdrol_1.Sys_PK);
CREATE VIEW qr_p2p1 AS SELECT r_p2p.Notas AS Notas, r_p2p.Sys_PK AS Sys_PK, tprelacion.Descripcion AS Tipo, CONCAT(persona.Apellido1, ' ', ISNULL(persona.Apellido2, ''), ' ', persona.Nombre) AS Nombre, mdrol.Nombre AS Rol1, mdrol_1.Nombre AS Rol2, r_p2p.IPersona1 AS IPersona1 FROM ((mdrol INNER JOIN (persona INNER JOIN (tprelacion INNER JOIN r_p2p ON tprelacion.Sys_PK = r_p2p.ITipo) ON persona.Sys_PK = r_p2p.IPersona2) ON mdrol.Sys_PK = r_p2p.RolPersona1) INNER JOIN mdrol mdrol_1 ON r_p2p.RolPersona2 = mdrol_1.Sys_PK);
CREATE VIEW qr_p2p2 AS SELECT r_p2p.Notas AS Notas, r_p2p.Sys_PK AS Sys_PK, tprelacion.Descripcion AS Tipo, CONCAT(persona.Apellido1, ' ', ISNULL(persona.Apellido2, ''), ' ', persona.Nombre) AS Nombre, mdrol.Nombre AS Rol2, mdrol_1.Nombre AS Rol1, r_p2p.IPersona2 AS IPersona2 FROM ((mdrol INNER JOIN (persona INNER JOIN (tprelacion INNER JOIN r_p2p ON tprelacion.Sys_PK = r_p2p.ITipo) ON persona.Sys_PK = r_p2p.IPersona1) ON mdrol.Sys_PK = r_p2p.RolPersona1) INNER JOIN mdrol mdrol_1 ON r_p2p.RolPersona2 = mdrol_1.Sys_PK);

