CREATE PROCEDURE qryProductosLikeII (@P VARCHAR(255), @Q VARCHAR(255), @R VARCHAR(255), @S VARCHAR(255), @T VARCHAR(255),@L VARCHAR(255), @M VARCHAR(255), @D VARCHAR(255), @A VARCHAR(255)) AS   BEGIN SELECT Producto.Sys_PK, Producto.Codigo, Producto.Descripcion, Producto.CodBar1, Producto.CodBar2, Producto.CodBar3, Producto.Precio1, Producto.Precio2,  Producto.Precio3, Producto.Precio4, Producto.Precio5, Existencias.Existencia, Marca.Descripcion as Marca, Linea.Descripcion as Linea,  Departamento.Descripcion as Departamento FROM Producto LEFT JOIN Existencias ON Producto.Sys_PK=Existencias.FK_Producto_IExistencias AND Existencias.IAlmacen=@A LEFT JOIN Linea on Producto.ILinea = Linea.Sys_PK LEFT JOIN Departamento ON Producto.IDepartamento = Departamento.Sys_PK  LEFT JOIN Marca on Producto.IMarca = Marca.Sys_PK WHERE Producto.Visible<>0 And (Producto.Codigo Like @P Or Producto.CodBar1 Like @Q  Or Producto.CodBar2 Like @R Or Producto.CodBar3 Like @S Or Producto.Descripcion Like @T) And (Existencias.IAlmacen=@A OR (Existencias.IAlmacen is null)) AND Producto.Iclase<>99 AND Producto.uf_inhabilitado=0  ORDER BY Producto.Descripcion; END